import React from 'react'

import './Portfolio.css'
import PortfolioVG from './PortfolioVG'
import PortfolioWEB from './PortfolioWEB'
export default function Portfolio() {
  return (
    <div className='portfolio'><h2>Checkout my work!</h2>
    <PortfolioVG />
    <PortfolioWEB /></div>
  )
}
